import React, { useState } from 'react';
import axios from "axios";
import { useNavigate } from 'react-router-dom';
function Bsolo2r() {
    const navigate = useNavigate();
    let [pd, spd] = useState([]);
    useEffect(() => {
      const pr = async () => {
        await axios.get("http://localhost:4000/bs2r").then((d) => {
          spd(d.data.bsolo2);
        });
      };
      pr();
    }, []);
    const cr = () => {
      navigate("/result");
    };
    return (
      <div className="sr">
        <div className="rc">
          <button id="rc" onClick={cr}>
            X
          </button>
        </div>
        <div className="pd">
          <div className="w">WINNER : 100</div>
          <div className="r">RUNNER : 50</div>
          <div className="k">KILL : 5</div>
        </div>
        <table>
          <thead>
            <tr>
              <th>POSITION</th>
              <th>PLAYER NAME</th>
              <th>KILLS</th>
              <th>CASH</th>
            </tr>
          </thead>
          <tbody>
            {pd.map((i,k) => {
              if (i.position === 1) {
                return (
                  <tr key={k}>
                    <td>{i.position}</td>
                    <td>{i.gamename}</td>
                    <td>{i.kills}</td>
                    <td>{i.kills * 5 + 100}</td>
                  </tr>
                );
              } else if (i.position === 2) {
                return (
                  <tr key={k}>
                    <td>{i.position}</td>
                    <td>{i.gamename}</td>
                    <td>{i.kills}</td>
                    <td>{i.kills * 5 + 50}</td>
                  </tr>
                );
              } else {
                return (
                  <tr key={k}>
                    <td>{i.position}</td>
                    <td>{i.gamename}</td>
                    <td>{i.kills}</td>
                    <td>{i.kills * 5}</td>
                  </tr>
                );
              }
            })}
          </tbody>
        </table>
      </div>
    );

}
export default Bsolo2r
